  "actions": [
    {
      "action": "navigate",
      "input": {
        "name": "B-08-199",
        "x": 1990,
        "y": 200
      }
    },
    {
      "action": "speak",
      "input": "Please check the inventory at B-08-199."
    },
    {
      "action": "navigate",
      "input": {
        "name": "Starting Point",
        "x": 0,
        "y": 0
      }
    }
  ]
}
```

